                    <el-input v-model="user.mobile" auto-complete="off"></el-input>
                </el-form-item>
                <el-form-item label="部门" :label-width="'120px'">
                    <el-button @click="depyDialog=true">{{chooseDeptData.deptId?chooseDeptData.deptName:'请选择部门'}}</el-button>
                </el-form-item>

                <el-dialog
                    width="30%"
                    title="请选择部门"
                    :visible.sync="depyDialog"
                    append-to-body>
                    <el-tree
                        :data="deptList"
                        :props="defaultProps"
                        node-key="deptId"
                        accordion
                        @node-click="clickDept"
                        :expand-on-click-node="false"
                    >
                    </el-tree>
