<script>
    export default {
        data() {
            return {
                editDialog:false,
                user:{},
                depyDialog:false,
                chooseDeptData:{
                    deptName: '',
                    deptId: '',
                },
                deptList: [],
                roleList: [],
                defaultProps: {
                    children: 'list',
                    label: 'name'
                },
            }
        },
        methods: {
            edit(id){
                // this.$prompt('请输入邮箱', '提示', {
                // confirmButtonText: '确定',
                // cancelButtonText: '取消',
                // inputPattern: /[\w!#$%&'*+/=?^_`{|}~-]+(?:\.[\w!#$%&'*+/=?^_`{|}~-]+)*@(?:[\w](?:[\w-]*[\w])?\.)+[\w](?:[\w-]*[\w])?/,
                // inputErrorMessage: '邮箱格式不正确'
                // }).then(({ value }) => {
                //     this.$message({
                //         type: 'success',
                //         message: '你的邮箱是: ' + value
                //     });
                //     }).catch(() => {
                //     this.$message({
                //         type: 'info',
                //         message: '取消输入'
                //     });       
                // });
                console.log($('.v-modal'))
                this.editDialog = true;
                this.$http.get('dc-admin/sys/user/info/'+id).then((response)=>{
                    var res = response.data;
                    if(res.code==0){
                        this.editForm=res.user;
                        this.chooseDeptData={
                            deptName: this.editForm.deptName,
                            deptId: this.editForm.deptId,
                        }
                    }
                })

            },
            clickDept(data) {
                //新增角色--选择角色-确认
                this.chooseDeptData = {
                    deptName: data.name,
                    deptId: data.deptId,
                }
            },
            editDialogFn(){
                this.editDialog = false;
            },
            // 确认修改
            editFinish(){
                this.$set(this.editForm,'deptId',this.chooseDeptData.deptId);
                this.$http.post('/dc-admin/sys/user/update',this.editForm,{type:'payload'}).then((response)=>{
                    var res= response.data;
                    this.editDialog=false;
                    if(res.code==0){
                        this.pageDataReq();
                        this.$message({
                            type: 'success',
                            message: '修改成功'
                        });
                    }else {
                        this.$message({
                            type: 'error',
                            message: res.msg
                        });
                    }
                })
            },
        },
        mounted() {
            this.user = window.userMes;
            this.$http.get('/dc-admin/sys/dept/list').then((response) => {
                var res = response.data;
                if (res.code == 0) {
                    this.deptList = [res.dept];
                }
            });
            this.$http.get('/dc-admin/sys/role/select').then((response) => {
                var res = response.data;
                console.log('666',response.data)
                if (res.code == 0) {
                    this.roleList = res.list;
                }
            })
        },
        props: {},
        watch: {}
    }
</script>
